var bodyRect = [8, 8, 1440, 794];

const getDiff = dataPositions => dataPositions.map((dp, i) => {
	if(i > 0){
		const last = dataPositions[i-1];
		return [
			dp[0] - last[0],
			dp[1] - last[1]
		]
	}
})


const length = xy => Math.sqrt(xy[0]*xy[0] + xy[1]*xy[1]);
const getSets = data => {
	const result = [];
	const step = 5;
	const predictionInterval = 5;
	const predictionSize = 10;
	let i = data.length - 1 - predictionInterval;
	while(data[i-predictionSize]){
		result.push(data.slice(i-predictionSize,i));
		i -= step;
	}
	return result;
}

const transformData = rawData => {
	const resultData = [];
	rawData.map(dataItem => {
		const positions = getDiff(dataItem.mousePositions);
		const sets = getSets(positions);
		sets.map((s,i) => {
			resultData.push({
				input: s.map(length),
				output: [i ? 0 : 1]
			})
		})
	})
	return resultData;
}

